sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        inputs = new JenkinsUtils().trimStringInputs(inputs);
        outputs.job_name = inputs.job_name;
        outputs.job_xml = inputs.job_xml;

        var parentPath = "";
        if (inputs.parent_folder_path.length != 0) {
            inputs.parent_folder_path = inputs.parent_folder_path.replace(
                /^\/|\/$/g, '');
            var parents = inputs.parent_folder_path.split('/');
            for (var i = 0; i < parents.length; i++) {
                if (!parentPath) {
                    parentPath = "/job/" + parents[i];
                } else {
                    parentPath += "/job/" + parents[i];
                }
            }
        }
        outputs.parent_folder_path = parentPath;
    } catch (e) {
        new JenkinsUtils().throwError('create_job');
    }
})(inputs, outputs);

